import { observable, action } from 'mobx';

class HomeworkStore {
  @observable
  sido = "default";

  @action
  setSido = (e, data) => {
    this.sido = data.target.value
  }

  @observable
  sigungu = "default";

  @action
  setSigungu = (e, data) => {
    this.sigungu = data.target.value
  }

  @observable
  bjdong = "default";

  @action
  setBjdong = (e, data) => {
    this.bjdong = data.target.value
  }

  @observable
  platGb = "default";

  @action
  setPlatGb = (e, data) => {
    this.platGb = data.target.value
  }





}
export default HomeworkStore;
